import React from 'react';
import '../css/Home.css';
import '../css/Bootstrap.css';

class Home extends React.Component{
  renderPanels(title){
    return(
      <div className="col-sm">
        {title}
      </div>
    );
  }

  render(){
    return(
        <div className="container">
          <div className="row row align-items-center">
            {this.renderPanels('hello')}
            {this.renderPanels('hello')}
            {this.renderPanels('hello')}
          </div>
        </div>
    );
  };
}

export default Home;
